import React, { Component } from 'react'

export class App extends Component {
  render() {
    return (
      <Router>

        <div>

            <Switch>
              <Route exact path='/' component={Home} />
              <Route path="/login" component={Login} />
              <Route path="/register" component={Register} />

            </Switch>

        </div>

    </Router>
    )
  }
}

export default App
